import Header from "../Header/Header";
import MobileNavBar from "../MobileNavBar/MobileNavBar";
import './ContactPage.css';

export default function ContactPage({ terms, onCatClick, category, onBurgerClick, onBurgerClose, isBurgerOpen }) {
  return (
    <>
      <Header 
      terms={terms}
      onCatClick={onCatClick}
      activeCategory={category}
      isBurgerOpen={isBurgerOpen}
      onBurgerClose={onBurgerClose}
      />
      <main className="contacts">
        <h1 className="">Контакты</h1>
        <div className="contacts-container">
          <div className="contacts_block_1">
            <div className="contacts-row">
              <div className="contacts-icon contacts-icon__phone"></div>
              <div>
                <p className="contacts-maintext">8 (800) 200 17 05</p>
                <p className="contacts-caption">Звонок бесплатный по России</p> 
              </div>
            </div>

            <div className="contacts-row">
              <div className="contacts-icon contacts-icon__phone"></div>
              <div>
                <p className="contacts-maintext">info@gemsvalley.ru</p>
                <p className="contacts-caption">По всем вопросам</p> 
              </div>
            </div>
          </div>
          <div className="contacts_block_1">
            
          </div>
        </div>
      </main>
      <MobileNavBar
      onBurger={onBurgerClick} 
      isBurgerOpen={isBurgerOpen} 
      onBurgerClose={onBurgerClose}
      />
    </>
  )
}

// - телефон 
// - почта 
// - график работы (принимаем заказы круглосуточно, телефон работает по графику)
